    "tooltip_port": {                                "en": "Port for admin interface. It must not be used by any other process. If running on linux with no root you cannot use ports below 1000.", "de": "Port für die Admin-Oberfläche. Der Port darf nicht von einem anderen Prozess belegt sein. Unter Linux dürfen nicht Root-Accounts nur die Ports über 1000 benutzen.", "ru": "Порт для интерфейса.",                            "pt": "Porta para a interface de administração. Ele tem que estar disponível. Se estiver executando no linux sem root, você não pode usar portas abaixo de 1000.", "nl": "Poort voor beheerdersinterface, deze moet beschikbaar zijn. Als u op Linux draait zonder root  kunt u geen poorten onder 1000 gebruiken.", "fr": "Port pour l'interface d'administration. Il doit être disponible. Les utilisateurs non-adminstratifs ne peuvent pas utiliser les ports inférieurs à 1000.", "it": "Porta per l'interfaccia di amministrazione. Deve essere disponibile. Se si esegue su Linux senza accesso root, non è possibile utilizzare le porte inferiori a 1000.", "es": "Puerto para la interfaz de administración. Tiene que estar disponible. Si se ejecuta en linux sin root, no puede utilizar puertos por debajo de 1000.", "pl": "Port dla interfejsu administratora. Musi być dostępny. Jeśli działasz na Linuksie bez roota, nie możesz używać portów poniżej 1000.", "zh-cn": "admin界面的端口。它必须是可用的。如果没有以root身份运行，则无法使用1000以下的端口。"},
